import * as actionType from "./actionType";


export const setHomeData = (homeData) => {
    return {
        type: actionType.SET_HOME_DATA,
        articleList: homeData.articleList,
        recommendList: homeData.recommendList,
        writerList: homeData.writerList
    }
}
